INSERT INTO `factors` VALUES ('factor01','Commitment of project workers','It is the perception among the project team than the project is going to be completed successfully. Some factors contributing to commitment include loyalty to project leader, ego satisfaction, and a sense of liking for the project and the resulting new product.'),('factor02','Communication','The need for adequate communication channels is extremely important in creating an atmosphere for successful project implementation. Communication is not only essential within the project team itself, but between the team and the rest of the organization as well as with the clients.'),('factor03','Correct distribution channel','The path through which product and services travel from the vendor to the consumer or payments for those products travel from the consumer to the vendor. A distribution channel can be as short as a direct transaction from the vendor to the consumer, or may include several interconnected intermediaries along the way such as wholesalers, distributors, agents and retailers. Each intermediary receives the item at one pricing point and moves it to the next higher pricing point until it reaches the final buyer.'),('factor04','Create, Make market interface','It determines the dependency relationship between the market and the product and how the product will/is accessing to the market.'),('factor05','Demand for quick result','An important part of evaluating the chances of carrying a project through to a successful conclusion is evaluating the patience of the supporting organization. Projects which start paying off soon are, everything else being equal, to be preferred over projects that have a distant payout. If there is not going to be enough patience, it may be best not to start. One of the worst mistakes that can be made in starting a project is to adopt, under pressure, an impossible time schedule and then miss the time check points built into the schedule.'),('factor06','Effectiveness of project manager','In high-tech firms the design features of the product can change a number of tunes due to the changing nature of the technology, and to unexpected events in the wider environment. If the project manager cannot effectively handle these changes and incorporate them into the design, the project may become obsolete even before its completion. The effectiveness with which the project manager handles changes in the technology and adapts to the environment is a key factor in the successful completion of the project.'),('factor07','Effects on other business','When successful completion of a new project would put the sponsoring organization in competition with one of its good customers for another product. A perception that introducing a new project might  hurt existing profitable businesses will almost certainly defeat proposals that the new project be implemented. One should try to  identify such conflicts early.'),('factor08','Emphasize Marketing','It determines if product type/innovation strategy is related to R&D/marketing programs and the market environment, and that R&D/marketing decisions, market characteristics, and product type/innovation strategy all influence new product sales performance.'),('factor09','Error free production','To measure how sensible is the product to errors while producing it.'),('factor10','High Level Management support','Top management\'s support of the project may involve aspects such as allocation of sufficient resources (including financial, manpower, time, etc.) as well as project management\'s confidence in their support in the event of crisis. It represents how confident is the Top management in the success of the project.'),('factor11','Inexpensive development','It measures the investment needed to develop the product.'),('factor12','Internal competition','Competition from another project for similar resources, in many cases, can act as a catalyst for successful project completion. The demand for the resources can force the project leader and his team to put in extra effort to complete the project successfully. Even if the groups are not working on the same project, the simple presence of multiple demands for resources may enhance the motivation of the project team.'),('factor13','Management and other skills','It measures if the company has people involved to cover all the skills that are needed in the product development.'),('factor14','Meeting cost schedules',' It measures how frequently schedules are revised. As much revisions the cost is increased.'),('factor15','Markets and Technique are strength','It measures the company strength in market and techniques. As much strength is the company as better results will be obtained and it will be easy to access to the market.'),('factor16','Monitoring and feedback','Monitoring and feedback refer to the project control process by which, at each stage of the project implementation, key personnel receive feedback on how the project is comparing to initial projections. Making allowances for adequate monitoring and feedback mechanisms gives the project manager the ability to anticipate problems, to oversee corrective measures, and to ensure that no deficiencies are overlooked. For our model, Monitoring and Feedback refers not only to project schedule and budget, but also to monitoring performance of members of the project team.'),('factor17','Newness to firm',' It measures if the product is new to the company or not. A product that is new to the firm is not a plus.'),('factor18','Organization plans','It measures if the organization has definite ideas about the types of business it wants to be in and the directions in which it wants to grow. These ideas are defined in long range plans, policies, statements of objectives and so forth. A  project will be much more warmly received if it fits these stated perceptions of the type of projects desired.'),('factor19','Potential interest of technical staff','In the evaluation of technical feasibility, the adequacy of technical staff resources to carry out a project are considered. The Environment question is whether the project is likely to attract the interest and enthusiasm of the technical staff. If the technical staff does  become interested in a project, the members will work nights as well as days, improve their skills related to doing the project and take an active rather than a  passive role in solving problems. The chances of a project succeeding are greatly enhanced by real technical staff interest.'),('factor20','Project mission','It measures if the product has clear and understandable goals as well as ultimate benefits at the outset, not only by the project team involved, but by the other departments in the organization. The goals of the project are in line with the general goals of the organization.'),('factor21','Project schedule','Project schedule refers to the importance of developing a detailed plan of the required stages of the implementation process. As developed in our model, Project Schedule/Plan refers to the degree to which time schedules, milestones, manpower, and equipment requirements are specified. Further, the schedule should include a satisfactory measurement system as a way of judging actual performance against budget and time allowances.'),('factor22','Project Manager as a project champion','It focuses on the project champion by suggesting that the most auspicious champion is the project manager himself and that his importance becomes must critical toward the end of the development phase. It measures the ability of the top management to push the project to become champion.'),('factor23','Qualified project manager','It measures if the company has a qualified project manager to lead the product to be successful.'),('factor24','Quantitative project selection','A quantitative project selection system-based on estimates of project cost, duration, and probability of technical completion and market estimates of sales and product life-was instituted by firms.'),('factor25','R&D process well planned','It measures if the R&D activities that are needed to develop the product has been properly scheduled. It is only applied when the project needs R&D activities.'),('factor26','Source of project ideas','It analyses where ideas come from. Two-thirds of the R&D projects stemmed from the R&D department. But it does not mean a high probability of technical completion. The projects stemming from the R&D department may be less firmly  based on market  realities  than those submitted by the marketing (and other) departments, so they may be more  likely to be stopped short of technical  completion  because of lack of potential profitability. On the other hand, because the R&D department understands the technical aspects of R&D projects so well, it tends to be a better judge than other departments of what is technically feasible.'),('factor27','Staff of professionals','It measures the level of qualification required to the staff.'),('factor28','Strong sales force','It measures the availability of a strong sales force to put the product into the market.'),('factor29','Technology tied to business strategy','Technology-push projects tend to be more ambitious and aimed at larger potential payoffs, the probability of economic success (given commercialization) may decrease as the percentage of R&D expenditures devoted to demand-pull projects increases. Technology-push projects are harder to sell to marketing, production, and other parts of the firm than those of demand-pull projects.'),('factor30','Technological background of managers','It measures if managers have a technological background facilitating the development of the product.'),('factor31','Timing','It measures if the product is developed when the interest in it is high. There will be times  when it is avoid for new projects and other times when it has little interest in them. A new project surely has a better Environment for acceptance when its timing is right.'),('factor32','Training and  Experience of own people','It measure if the project could be performed by the own people or if it depends on external people.'),('factor33','Trouble shooting','It is impossible to foresee every trouble area or problem that could possibly arise. As a result, it is important that the project manager make adequate initial arrangements for Trouble-Shooting mechanisms to be included in the implementation plan. Such mechanisms would make it easier to not only react to problems as they arise, but to foresee and possibly forestall potential problems areas in the implementation process.'),('factor34','Understanding market','Growing business without understanding your competitors is risky. Market research can prepare you for changing markets and prevent the product being left behind by the competition.'),('factor35','Use outside communication','It measure the impact of using external communication and additional communication channels to develop the product.'),('factor36','Technology route','A clear understanding of the technological route is a prerequisite for the success of a project. However in the high tech area the technological route tends to he disjointed as new developments come on the horizon fairly quickly. Nevertheless, the project should stay on the original technological track and not veer widely from that route . This is very important in high tech firms.'),('factor37','Risk Distribution','The commercial success of the product does not depend on the narrow line of production and market.'),('factor38','Competitive environment','The competitive environment, also known as the market structure, is the dynamic system in which business competes. The state of the system as a whole limits the flexibility of your business. It describes the ease  of market entry.'),('factor39','Competitor analysis','It is a strategic technique used to evaluate outside competitors. The analysis seeks to identify weaknesses and strengths that a company\'s competitors may have, and then use that information to improve efforts within the company. Three factors are important in analyzing the competition. The first is the ability of a competitor to take defensive measures; a well-managed company with low costs and a strong cash flow might easily fend off competitors. The second is patent protection; an innovation is likely to have more success if it has strong patent protection against competitors. The third is the pace of change in the technology; if innovation occurs quickly in an area, a new development may be obsolete in only a few years.'),('factor40','Early analysis of market and competitors','It measures if a market analysis has been performed in advance. The competitor analysis may give the toughest time, especially if the company is new to the marketplace.'),('factor41','Early to market','It measures if the market is mature enough to accept the product.'),('factor42','Few competitors','Few competitors mean fewer firms are competing for the same customers and resources. Relatively Few Competitors will have a long-term positive impact, which adds to its value. This statements will have a short-term positive impact, which adds to its value. This qualitative factor will lead to a decrease in costs.'),('factor43','High Contribution margin','The contribution margin is the marginal profit per unit sale, and is the sum of a company\'s turnover minus their direct costs. This factor measures how flexible is the contribution margin.'),('factor44','Life cycle of product','If the product is in the growth phase of its life cycle the rate of new product introduction will he high, which leads to a higher degree of success . If it is in the infancy stage the product may still not be fully developed resulting in many false starts. On the other hand, a mature product will require enormous resources in order to introduce new variations. Most high technology projects are in the infancy or the growth stage.'),('factor45','Lower cost','It measures if the product is providing a lower cost than other competitors existing in the same category. Will the product offer to the customer in terms of unique features the lower cost?'),('factor46','Market analysis',' An evaluation of the market for a company\'s goods and services. Research that offers assistance in forecasting price trends for stocks and bonds. Market analysis may concentrate on fundamental factors including earnings, inflation, and costs, or it may be directed at technical considerations such as trading volume and price charts.'),('factor47','Market existence',' It measures if is there any existing market or if this product is creating a new market. An existing marketing and distribution system which can present and distribute the new product is a real asset to a project.'),('factor48','Meet customer needs/wants','It measures if the product is developed because there is a identified of customer needs/wants.'),('factor49','Number of end users','It measures the number of end users in relationship with the market size. In their enthusiasm, the originators may perceive their new idea to be applicable in a number of widely unconnected markets . Unfortunately, much fruitless effort will be spent in designing a general product which can be used in a variety of situations . This results in a loss of focus in product design.'),('factor50','Perceived value','A customer\'s opinion of a product\'s value to him or her. It may have little or nothing to do with the product\'s market price, and depends on the product\'s ability to satisfy his or her needs or requirements. It is an important marketing concept. It lies at the heart of marketing and deals solely with the customer\'s perception of a product. Perceived value is a consolidated measure because it takes into account subjective perceptions with limits placed on it by price and other objective costs.'),('factor51','Probability of commercial success','Even when the allocation of funding into different classifications increases the odds of funding a riskier R&D project, it is still necessary to allocate funds within each classification. A possible approach for deciding between projects is to use expected commercial value (ECV), which amalgamates the probabilities of success into a more standard net present value calculation.'),('factor52','Rate of new product introduction','If new products or significant adaptations are introduced In the market fairly regularly, say once in six months or less, it demonstrates that there is a great deal of product Innovation taking place and that the market has not stabilized. Therefore, any new product with improvements over existing products has a good chance of being successful . For example if one is in the digital watch industry, any new gimmick on a new watch design, provided it meets other market considerations, has a good chance of success . Moreover, since so many different designs are being introduced, another new one is unlikely to be seriously hurt in the market.'),('factor53','Response to growing markets','Emerging markets are those countries that have growing economies and a growing middle class. Some of these countries were once poor, and some still have high rates of poverty. Many are undergoing profound social and political change for the better. A sector of the economy experiencing a higher-than-average growth rate. Growth industries are often associated with new or pioneer industries that did not exist in the past and their growth is related to consumer demand for the new products or services offered by the firms within the industry.'),('factor54','Sales/profit potential','It measures if the gross sale decreases that also affect the profits by decreasing them because the gross sales are the total amount of the sale before any discounts or allowances are made on the sale. If the gross sales increase then the amount of profit also increases because the more company sells the more the company has the potential to make more profit. It the project will not be profitable enough around 40% before-tax return it should be abandoned.'),('factor55','Slow growth market',' An increase in the demand for a particular product or service over time. Market growth can be slow if consumers do not adopt a high demand or rapid if consumers find the product or service useful for the price level. For example, a new technology might only be marketable to a small set of consumers, but as the price of the technology decreases and its usefulness in every day life increases, more consumers could increase demand. A market that currently exhibits low trading volumes and/or low volatility levels. The term slow market can be used to describe a market with few issues coming up for sale to investors through initial public offerings and secondary offerings in the equity markets, or through new issuance in the corporate bond market.'),('factor56','Strength of market','Market strength is a broad term that can mean a lot of things, depending on how we define it. Market strength can be a measure of a market\'s power to perform either on a relative basis (vs. other markets) or on an absolute basis (vs. its own historical levels of momentum and investor participation).'),('factor57','Client acceptance','It refers to the final stage in the implementation process, at which time the ultimate efficacy of the project is to be determined. Too often project managers make the mistake of believing that if they handle the other stages of the implementation process well, the client (either internal or external to the organization) will accept the resulting project. In fact, client acceptance is a stage in project implementation that must be managed like any other.'),('factor58','Available Resources or Raw material','Raw material is a material or substance used in the primary production or manufacturing of a good. The more certain the supply of necessary raw materials or components, the greater are the chances of business success.'),('factor59','Government Regulations','It represents when the legislative and executive branches set and enact laws that determine how a specific task, business, or industry is supposed to run.'),('factor60','Industry restructure opportunity','A new entrant can become the dominant competitor when it makes technological breakthroughs in a stagnant industry, particularly when the new entrant has strong patent protection and competitors are small and fragmented. Also a basic innovation in an existing market offers opportunities to capture downstream use or application markets.'),('factor61','Political/Social factors','It represents political or social factors that could impact in product development like Antitrust, Ecology, Foreign eXChange, Geography or Sovereign rights.'),('factor62','Public interest on product','Public interest is a principle by which the government can request that sensitive documents are not used as evidence in a trial, on the grounds that to do so would be against the public or national interest. It represents in which the whole society has a stake and which warrants recognition, promotion, and protection by the government and its agencies.'),('factor63','Product liability','The legal liability a manufacturer or trader incurs for producing or selling a faulty product. It measures the responsibility of the company to ensure that products are safe and do not cause injury to users.'),('factor64','Demand Pull vs Technology push','Technology-push projects tend to be more ambitious and aimed at larger potential payoffs. Demand-pull means that there is market behind the product. Technology-push projects are harder to sell to marketing, production, and other parts of the firm than those of demand-pull projects. It is quite likely that technology-push projects tend to be more risky than demand-pull  projects.'),('factor65','Directions for scientific development','It measures is the product is opening new directions for scientific development. These directions will promote new patents or new objects.'),('factor66','High performance/cost proportion','The cost-performance ratio is an equation used to balance the cost of an item against its effectiveness. This process can help buyers with making purchasing decisions by assigning rankings to a series of items based on a variety of factors. Cost-performance can also be used to analyze trends in production.'),('factor67','Incremental product','Incremental product innovation concerns an existing product whose performance has been significantly enhanced or upgraded. This again can take two forms. A simple product may be improved (in terms of improved performance or lower cost) through use of higher performance components or materials, or a complex product which consists of a number of integrated technical subsystems may be improved by partial changes to one of the subsystems.'),('factor68','Innovative product','It measures if the product was highly innovative-totally new to the market.'),('factor69','Patents','Protected by a trademark or a brand name so as to establish proprietary rights analogous to those conveyed by letters patent or a patent.'),('factor70','Problem definition','it measures if the product is properly defined. Customer needs for new products are difficult to articulate and sort out, because the customers themselves may not be sure, the knowledge itself is often tacit, and that knowledge may be embedded in a context of use and not retrievable except by hands-on interaction with that context. To put problem definition more positively, successful new products have more market knowledge than failed ones.'),('factor71','Probability of technical success','If the project is proceeding along a fairly well defined technological route, and there are not many unsolved technological problems the probability of success will remain the same as before or may even increase. On the other hand, technological problems in some key area may make the project unfeasible. '),('factor72','Utility','It represents if the developed product is perceived as useful by customers, that may result from a project is  the utility of the product to those who will buy and use it. It measures the level of utility of the product. Utility should be judged in relation to other products the customer may use to fulfill a need.');
