INSERT INTO `modelitems` VALUES ('mid201','modelBa1997u','dim01','factor01','positive',1,'In the case of SiS, it is interpreted in the same way.',' It should be rated with <i>Very high</i> when the team has the perception about the success of the project and with <i>Very low</i> it is not clear if the project is going to be finished.'),('mid202','modelBa1997u','dim01','factor02','positive',1,'In the case of SiS, it is interpreted in the same way.',' It should be rated with <i>Very high</i> when the product could be developed with very few or none communication dependency with the customer and with <i>Very low</i> when communication with customer or development team is critical for the project success.'),('mid203','modelBa1997u','dim01','factor03','positive',1,'In the case of SiS, it is focused on the different distribution channels and the impact that these channels have in the product distribution. Is the product available to direct download from Internet? Do customer need special channels to access to the product?','It should be rated with <i>Very high</i> when the success does not depends on the distribution channel and with <i>Very low</i> when the product success depends on the distribution channel.'),('mid204','modelBa1997u','dim01','factor04','positive',1,'In the case of SiS, it is interpreted in the same way.',' It should be rated with <i>Very high</i> when the access to the market already exists and the product is going to use it and with <i>Very low</i> when it is critical to have a clear interface to access to the market and the product should create the interface.'),('mid205','modelBa1997u','dim01','factor05','positive',1,'In the case of SiS, it is interpreted in the same way.','It should be rated with <i>Very high</i> when there is patience enough to start paying off and with <i>Very low</i> when there is not going to be enough patience to start paying off soon.'),('mid206','modelBa1997u','dim01','factor06','positive',1,'In the case of SiS, it is interpreted in the same way.','It should be rated with <i>Very high</i> when the project requires that the project manager handle changes in the environment and technology very fast; therefore the project manager needs to have the ability to handle changes in a fast way and with <i>Very low</i> when the project does not require to react in a fast way when the environment or technology is changing and therefore, the project manager does not need to be able to handle changes.'),('mid207','modelBa1997u','dim01','factor07','positive',1,'In the case of SiS, it is interpreted in the same way.','It should be rated with <i>Very high</i> when there are no other projects at the same time for the same team in competition in the same company and with <i>Very low</i> when there are other projects in competition in the same company.'),('mid208','modelBa1997u','dim01','factor08','positive',1,'In the case of SiS, it is interpreted in the same way.','It should be rated with <i>Very high</i> when sales do not depend on marketing campaigns and with <i>Very low</i> when marketing decisions have a deep impact on product sales.'),('mid209','modelBa1997u','dim01','factor09','positive',1,'In the case of SiS, this factor measures the level of testing performed to assure that the product is error free.','It should be rated with <i>Very high</i> when the product is going to be tested exhaustively previous to be on the market and with <i>Very low</i> when no specific testing processes are needed.'),('mid210','modelBa1997u','dim01','factor10','positive',1,'In the case of SiS, it is interpreted in the same way.',' It should be rated with <i>Very high</i> when the Top management of the company is supporting the project and with <i>Very low</i> when the project is supported by departments but there is not a clear support from the company\'s structure.'),('mid211','modelBa1997u','dim01','factor11','positive',1,'In the case of SiS, it is interpreted in the same way. Could the product be developed with the resources available in the company?.','It should be rated with <i>Very high</i> when the company has resources enough to develop the product and with <i>Very low</i> when the company does not have resources enough and it should make an investment to develop the product.'),('mid212','modelBa1997u','dim01','factor12','positive',1,'In the case of SiS, it is interpreted in the same way.','It should be rated with <i>Very high</i> when the product is receiving synergies from existing or previous development in the company and with <i>Very low</i> when the project is not receiving synergies from other projects from the company.'),('mid213','modelBa1997u','dim01','factor13','positive',1,'In the case of SiS, it is interpreted in the same way.','It should be rated with <i>Very high</i> when all the skills needed for the project are covered by the company and with <i>Very low</i> when most of the requested skills are missing.'),('mid214','modelBa1997u','dim01','factor14','positive',1,'In the case of SiS, it is interpreted in the same way','It should be rated with <i>Very high</i> when the project is managed in a way where very few review meetings are need and schedules are revised very few and with <i>Very low</i> when schedules are revised frequently.'),('mid215','modelBa1997u','dim01','factor15','positive',1,'In the case of SiS, it is interpreted in the same way.','It should be rated with <i>Very high</i> when the company is strength in the market and the technology needed to develop the product and with <i>Very low</i> both market and technology are new for the company.'),('mid216','modelBa1997u','dim01','factor16','positive',1,'In the case of SiS, it is interpreted in the same way.','It should be rated with <i>Very high</i> when the product is developed with fast feedback loops and with <i>Very low</i> when the product is developed without any feedback.'),('mid217','modelBa1997u','dim01','factor17','both',1,'In the case of SiS, it is interpreted in the same way.',' It should be rated with <i>Very high</i> when the product is not completely new because the company has a background and with <i>Very low</i> when the product is completely new and, therefore, the knowledge about both the product and market is limited.'),('mid218','modelBa1997u','dim01','factor18','positive',1,'In the case of SiS, it is interpreted in the same way.','It should be rated with <i>Very high</i> when the company has established plans to develop the product and with <i>Very low</i> when there are no clear directions in which the company wants to grow.'),('mid219','modelBa1997u','dim01','factor19','positive',1,'In the case of SiS, it is interpreted in the same way.','It should be rated with <i>Very high</i> when the technical staff is interested in the project and with <i>Very low</i> when there is no special interest in the staff about the project.'),('mid220','modelBa1997u','dim01','factor20','positive',1,'In the case of SiS, it is interpreted in the same way.','It should be rated with <i>Very high</i> when the goal of the product are clearly stated and aligned with the company and with <i>Very low</i> when the neither the goals are stated nor the product is aligned with the company strategy.'),('mid221','modelBa1997u','dim01','factor21','positive',1,'In the case of SiS, it is interpreted in the same way.',' It should be rated with <i>Very high</i> when the product development has been scheduled before starting the project and with <i>Very low</i> when the schedule is being built as the product is developed.'),('mid222','modelBa1997u','dim01','factor22','positive',1,'In the case of SiS, it is interpreted in the same way.','It should be rated with <i>Very high</i> when there is a project leader or a team with the ability to push the project when the development is stack and with <i>Very low</i> when no one has the ability to push the project.'),('mid223','modelBa1997u','dim01','factor23','positive',1,'In the case of SiS, it is interpreted in the same way.',' It should be rated with <i>Very high</i> when the project manager is skilled enough to lead the project. He knows the product and the market and with <i>Very low</i> when the project manager does not know the scope of the project.'),('mid224','modelBa1997u','dim01','factor24','positive',1,'In the case of SiS, it is interpreted in the same way.','It should be rated with <i>Very high</i> when the project was selected being the best evaluated considering among others: cost, duration or market and with <i>Very low</i> when no quantitative data supports the project selection.'),('mid225','modelBa1997u','dim01','factor25','positive',1,'In the case of SiS, it is interpreted in the same way.',' It should be rated with <i>Very high</i> when R&D activities are scheduled and with <i>Very low</i> when R&D activities are performed as they happen.'),('mid226','modelBa1997u','dim01','factor26','positive',1,'In the case of SiS, it is interpreted in the same way.','It should be rated with <i>Very high</i> when the project is pushed by the same department that proposed the idea and it has the skills enough to develop the project and with <i>Very low</i> when the idea is proposed and developed by different departments.'),('mid227','modelBa1997u','dim01','factor27','positive',1,'In the case of SiS, it is interpreted in the same way.','It should be rated with <i>Very high</i> when the staff is composed by professional and with <i>Very low</i> when the staff does not have special skills.'),('mid228','modelBa1997u','dim01','factor28','positive',1,'In the case of SiS, it is interpreted in the same way. All the existing distribution channels to put SiS in the market should be considered.','It should be rated with <i>Very high</i> when the company has a strong sales department to distribute the product and with <i>Very low</i> the company does not have a strong sales department.'),('mid229','modelBa1997u','dim01','factor29','positive',1,'In the case of SiS, it is interpreted in the same way.','It should be rated with <i>Very high</i> when the technology needed to develop the product is part of the strategy of the company and with <i>Very low</i> when the technology needed is not aligned with the company strategy.'),('mid230','modelBa1997u','dim01','factor30','positive',1,'In the case of SiS, it is interpreted in the same way.','It should be rated with <i>Very high</i> when managers know the technology needed to develop the product and with <i>Very low</i> when managers are not familiar with the technology.'),('mid231','modelBa1997u','dim01','factor31','positive',1,'In the case of SiS, it is interpreted in the same way.','It should be rated with <i>Very high</i> when it is the right time in terms off commitment, expenditures and satisfaction in the product line and with <i>Very low</i> when the company is more focused on other product lines.'),('mid232','modelBa1997u','dim01','factor32','positive',1,'In the case of SiS, it is interpreted in the same way.',' It should be rated with <i>Very high</i> when the product could be developed with the available resources in the company and with <i>Very low</i> when new people should be enrolled to the company to perform the product.'),('mid233','modelBa1997u','dim01','factor33','positive',1,'In the case of SiS, it is interpreted in the same way and also considering different technological alternatives for implementing the product.','It should be rated with <i>Very high</i> when product metrics have been defined to prevent and detect problems and with <i>Very low</i> when no risk analysis has been performed and there are no metrics to control the product development.'),('mid234','modelBa1997u','dim01','factor34','both',1,'In the case if SiS, it is interpreted in the same way.','It should be rated with <i>Very high</i> when the market and the target for the product have been clearly identified and with <i>Very low</i> when the market has not been studied in advance to product development.'),('mid235','modelBa1997u','dim01','factor35','both',1,'In the case of SiS, it is interpreted in the same way.','It should be rated with <i>Very high</i> when no outside communication has been applied to develop the product; that is team did not needed additional communication channels to develop the product and with <i>Very low</i> when additional communication channels have been required in the development delaying or increasing the complexity of the development.'),('mid236','modelBa1997u','dim01','factor36','positive',1,'In the case of SiS, it is interpreted in the same way.','It should be rated with <i>Very high</i> when the product technological route is well defined and with <i>Very low</i> there was no agreement about the technological route to be taken. '),('mid237','modelBa1997u','dim02','factor38','both',1,'In the case of SiS it is interpreted in the same way.','It should be rated with <i>Very high</i> when the market entry barriers are low and with <i>Very low</i> when it is hard to access to the market.'),('mid238','modelBa1997u','dim02','factor39','positive',1,'In the case of SiS it is interpreted in the same way.','It should be rated with <i>Very high</i> when very few competitors are in the market and with <i>Very low</i> there are several competitors providing similar products or services.'),('mid239','modelBa1997u','dim02','factor40','negative',1,'In the case of SiS it is interpreted in the same way.',' It should be rated with <i>Very high</i> when a market analysis has not been performed in advance to the product development and with <i>Very low</i> when a market analysis has been performed before.'),('mid240','modelBa1997u','dim02','factor41','negative',1,'In the case of SiS it is interpreted in the same way.','It should be rated with <i>Very high</i> when the market is not mature to accept the product because the product is disruptive and with <i>Very low</i> when the market is mature to accept the new product.'),('mid241','modelBa1997u','dim02','factor42','positive',1,'In 