ry low</i> when a market analysis has been performed before.'),('mid140','modelBa1997w','dim02','factor41','negative',0.02,'In the case of SiS it is interpreted in the same way.','It should be rated with <i>Very high</i> when the market is not mature to accept the product because the product is disruptive and with <i>Very low</i> when the market is mature to accept the new product.'),('mid141','modelBa1997w','dim02','factor42','positive',0.02,'In the case of SiS it is interpreted in the same way.','It should be rated with <i>Very high</i> when few competitors are in the market and with <i>Very low</i> too many competitors are in the market.'),('mid142','modelBa1997w','dim02','factor43','positive',0.07,'In the case of SiS it is interpreted in the same way.','It should be rated with <i>Very high</i> when the company has flexibility to fix the marginal profit and with <i>Very low</i> when the profit is fixed by the market and the existing competitors.'),('mid143','modelBa1997w','dim02','factor44','both',0.05,'In the case of SiS it is interpreted in the same way.','It should be rated with <i>Very high</i> when the product is in the growth phase and with <i>Very low</i> when the product is in the infancy or the market is too mature.'),('mid144','modelBa1997w','dim02','factor45','positive',0.1,'In the case of SiS it is interpreted in the same way.','It should be rated with <i>Very high</i> when it is able to put on the market the product at lower prices than competitors with the same features and with <i>Very low</i> when there are some other products from competitors with the same features and at lower prices.'),('mid145','modelBa1997w','dim02','factor46','both',0.05,'In the case of SiS it is interpreted in the same way.','It should be rated with <i>Very high</i> when the company has performed a market analysis for the product before to be put in the market and with <i>Very low</i> when there is not a market analysis for the product. It means a high risk.'),('mid146','modelBa1997w','dim02','factor47','positive',0.1,' In the case of SiS it could be interpreted as if the market is ready to accept the new functionality provided the product. ','It should be rated with <i>Very high</i> when the market is mature enough or is requesting new functionalities and it ready to accept new products and with <i>Very low</i> when the market is comfortable with the existing products and it is not demanding new functionalities.'),('mid147','modelBa1997w','dim02','factor48','both',0.05,'In the case of SiS it is interpreted in the same way.','It should be rated with <i>Very high</i> when the product is driven by a custormer who has a need and with <i>Very low</i> when there is no a final customer defining the product.'),('mid148','modelBa1997w','dim02','factor49','positive',0.05,'In the case of SiS it is interpreted in the same way.','It should be rated with <i>Very high</i> when the number of users is enough to keep the product focused and with <i>Very low</i> when the number of users is small, so that companies tend to design a general product reducing the innovation.'),('mid149','modelBa1997w','dim02','factor50','positive',0.05,'In the case of SiS it is interpreted in the same way.','It should be rated with <i>Very high</i> when the user consider that product is providing a high value and customers perceive that the product will help them  and with <i>Very low</i> when it is not clear how much value is providing the product.'),('mid150','modelBa1997w','dim02','factor51','positive',0.05,' In the case of SiS it is interpreted in the same way.','It should be rated with <i>Very high</i> when it is expected a commercial success and with <i>Very low</i> when it is unknown or it is not clear the commercial success.'),('mid151','modelBa1997w','dim02','factor52','positive',0.05,'In the case of SiS the time frame is less than six month. It is typical to launch new versions every three months. Due to the nature of software the rate of new product could be high in opening market.','It should be rated with <i>Very high</i> when the number of product introduction is growing for a market and with <i>Very low</i> the number of new products in the market is very low or even null.'),('mid152','modelBa1997w','dim02','factor53','positive',0.02,'In the case of SiS growing markets are not related with growing economies but to new sectors where SiS are applied.','It should be rated with <i>Very high</i> when the product is become a pioneer in the market and with <i>Very low</i> the product does not belong to a growing market but a well established market.'),('mid153','modelBa1997w','dim02','factor54','positive',0.05,' In the case of SiS it is interpreted in the same way.','It should be rated with <i>Very high</i> when the factor is greater than 40 \\% and with <i>Very low</i> when the factor is less than 40\\%'),('mid154','modelBa1997w','dim02','factor55','negative',0.02,'In the case of SiS it is interpreted in the same way.','It should be rated with <i>Very high</i> when the market growth is very slow considering a mature market and with <i>Very low</i> when the growth is slow but the market is quite new.'),('mid155','modelBa1997w','dim02','factor56','positive',0.05,'In the case of SiS it is interpreted in the same way.','It should be rated with <i>Very high</i> when the market has a huge amount of potential users and there are some other products in the market and with <i>Very low</i> when the market is not solid or it is starting.'),('mid156','modelBa1997w','dim02','factor57','positive',0.02,'In the case of SiS, it is interpreted in the same way.','It should be rated with <i>Very high</i> when the product is the last stage of development and with <i>Very low</i> when the product is still under development.'),('mid157','modelBa1997w','dim02','factor37','positive',0.02,'In the case of SiS it measures if the product success is independent of distribution channel or if the distribution channel is limiting the product accessing to the market.','It should be rated with <i>Very high</i> when the market is accessible without limitation of the existing distribution channels and with <i>Very low</i> when the market distribution channel is very restrictive.'),('mid158','modelBa1997w','dim03','factor58','positive',0.36,'In the case of SiS, it concerns with the components (software and hardware) and their stability needed to implement the system.',' It should be rated with <i>Very high</i> when all the components are available and stable and with <i>Very low</i> when most of the needed resources will be provided by external companies or when they are not mature enough.'),('mid159','modelBa1997w','dim03','factor59','both',0.09,'In the case of SiS, it is interpreted in the same way.','It should be rated with <i>Very high</i> when government regulations are defined and no changes are expected and with <i>Very low</i> when there are no government regulations yet but they are expected to be defined in the future what could require companies to make extensive changes resulting in greatly Increased costs for the final product. In this case <i>Very low</i> represents a negative impact.'),('mid160','modelBa1997w','dim03','factor60','both',0.09,'In the case of SiS, it is interpreted in the same way.','It should be rated with <i>Very high</i> when the product is breaking the market and competitors are small and fragmented and with <i>Very low</i> when the product is part of a market with many competitors. In this case <i>Very low</i> represents a negative impact.'),('mid161','modelBa1997w','dim03','factor61','both',0.18,'In the case of SiS it is interpreted in the same way.','It should be rated with <i>Very high</i> when product development is not affected by political or social factors outside the company and with <i>Very low</i> when product development depends on political or social institutions. In this case <i>Very low</i> represents a negative impact.'),('mid162','modelBa1997w','dim03','factor62','both',0.09,'In the case of SiS it is interpreted in the same way.','It should be rated with <i>Very high</i> when the product is considered as relevant to a mass population or market and with <i>Very low</i> when the product is targeted to a tight market or population.'),('mid163','modelBa1997w','dim03','factor63','negative',0.09,'In the case of SiS, however, is now the principle controlling element in many industrial and consumer products. It is so pervasive that it is found in just about every product that is labelled electronic. Software can cause products to do strange and even terrifying things. Software bugs and errors could mean injuries or damages.','It should be rated with <i>Very high</i> when the risk of injuries is high and with <i>Very low</i> when the risk of injuries is very low, but they could happen. In the case of no injuries risk, this factor should be rated as <i>Not Applicable}.'),('mid164','modelBa1997w','dim03','factor37','positive',0.09,'In the case of SiS it measures if the product success is independent of distribution channel or if the distribution channel is limiting the product.','It should be rated with <i>Very high</i> when the product could be distributed by many distribution channels and markets and with <i>Very low</i> when the distribution channel is very restrictive.'),('mid165','modelBa1997w','dim04','factor64','both',0.13,'In the case of SiS, it is interpreted in the same way.','It should be rated with <i>Very high</i> when the product could be categorized as demand-pull and with <i>Very low</i> when the product could be categorized as technology-push.'),('mid166','modelBa1997w','dim04','factor65','positive',0.04,'In the case of SiS, it is interpreted in the same way but extending the concept of patents to copyrighted software.',' It should be rated with <i>Very high</i> when new copyrights could be derived from the product and the new directions and with <i>Very low</i> when no new directions were associated to the product.'),('mid167','modelBa1997w','dim04','factor66','positive',0.13,'It is also known as price/performance ratio. The most desirable outcome is that the item is low cost, but high performance. In the middle of the scale are products that are either high performance and high cost, or low performance and low cost. The least desirable ranking tends to be for a product that is high cost, but low performance.  As technology has advanced, products have become more powerful and increasingly more accessible to consumers.','It should be rated with <i>Very high</i> when the product provides as much performances as expected by customers with the lowest cost and with <i>Very low</i> when the cost of the product is still high.'),('mid168','modelBa1997w','dim04','factor67','positive',0.04,'In the case of SiS, it is interpreted in the same way.','It should be rated with <i>Very high</i> when product could be put into the market in an incremental way by adding new features and with <i>Very low</i> when the product can not be put into the market incrementally.'),('mid169','modelBa1997w','dim04','factor68','positive',0.08,'In the case of SiS, it is interpreted in the same way.','It should be rated with <i>Very high</i> when the product is completely new to the market and with <i>Very low</i> when the product does not provide any new features or it has very few new features.'),('mid170','modelBa1997w','dim04','factor69','positive',0.04,'In the case of SiS, a software patent is a patent that is provided to enhance computer performance by means of a computer application. There is no legal or conclusive definition for a software patent. This and the topic of related intellectual property (IP) protection rights have been intensely debated at all levels in the tech world. Different countries have different restrictions on patenting software innovations.','It should be rated with <i>Very high</i> when the software has many new components that have been copyrighted and with <i>Very low</i> when the intellectual property is not relevant to the product.'),('mid171','modelBa1997w','dim04','factor70','positive',0.08,'In the case of SiS, it is interpreted in the same way.','It should be rated with <i>Very high</i> when product features are well defined and the product is goal is clear and with <i>Very low</i> when product features are not defined or if the product does not have clear goals.'),('mid172','modelBa1997w','dim04','factor71','positive',0.21,'In the case of SiS, it is interpreted in the same way.','It should be rated with <i>Very high</i> when the product technological route is well defined and they are feasible and with <i>Very low</i> when there is a high technological risk, that is, technology is not available and it is expected some delays due to technology.'),('mid173','modelBa1997w','dim04','factor72','both',0.04,'In the case of SiS, it is interpreted in the same way.','It should be rated with <i>Very high</i> when the product is considered as useful to a wide range of customers and with <i>Very low</i> when it is not clear how useful is to customers or it is only useful to a small group of customers.'),('mid174','modelBa1997w','dim04','factor36','positive',0.08,'In the case of SiS, it is interpreted in the same way.','It should be rated with <i>Very high</i> when the product technological route is well defined and with <i>Very low</i> there was no agreement about the technological route to be taken.'),('mid175','modelBa1997w','dim04','factor57','positive',0.04,'In the case of SiS, it is interpreted in the same way.',' It should be rated with <i>Very high</i> when the product is the last stage of development and with <i>Very low</i> when the product is still under development.'),('mid176','modelBa1997w','dim04','factor37','positive',0.04,'In the case of SiS, it measures how the environment could affect to the product distribution. If the product success is independent of distribution channel technology or if the distribution channel technology is limiting the product.','It should be rated with <i>Very high</i> when the product could be distributed by many distribution channels and markets and with <i>Very low</i> the distribution channel is very restrictive.'),('mid177','modelBa1997w','dim04','factor63','negative',0.04,'In the case of SiS, however, is now the principle controlling element in many industrial and consumer products. It is so pervasive that it is found in just about every product that is labelled electronic. Software can cause products to do strange and even terrifying things. Software bugs and errors could mean injuries or damages.','It should be rated with <i>Very high</i> when the risk of injuries derived from the technology used is very low, but they could happen and with <i>Very low</i> when the risk of injuries derived from the technology used is high. In the case of no injuries risk, this factor should be rated as <i>Not Applicable}.');
